/**
 * @license
 * Copyright 2018 Google LLC
 * SPDX-License-Identifier: Apache-2.0
 */

// Style preference for leading underscores.
// tslint:disable:strip-private-property-underscore

import {customElement} from 'lit/decorators.js';

import {TabScrollerBase} from './mwc-tab-scroller-base.js';
import {styles} from './mwc-tab-scroller.css.js';

declare global {
  interface HTMLElementTagNameMap {
    'mwc-tab-scroller': TabScroller;
  }
}

@customElement('mwc-tab-scroller')
export class TabScroller extends TabScrollerBase {
  static override styles = [styles];
}
